const getVideoList = () => {

  const arrVBA = {title:""}
  return (
    <React.Fragment>
      <div className="col-3">
        <iframe
          width="560"
          height="315"
          src="https://www.youtube.com/embed/"
          frameborder="0"
          allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </div>
    </React.Fragment>
  );
};

const Media = () => (
  <div>
    <h1>Youtube Code goes here</h1>
    <div className="row">{getVideoList()}</div>
  </div>
);

export default Media;
